import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the notifications button to open the notifications modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForLoadState('networkidle');

    // Take a screenshot of notifications modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_opened.png'));

    // Wait for notification time elements to load
    await page.waitForSelector('.notification-time');

    // Extract notification time data
    const notificationTimes = await page.$$eval('.notification-time', elements => {
      return elements.map(el => el.textContent.trim());
    });

    // Convert the times to timestamps (assuming they are in a consistent format)
    const timestamps = notificationTimes.map(time => {
      const now = new Date();
      const timeParts = time.split(' '); // e.g., ["2", "hours", "ago"]
      let date = new Date(now);

      if (timeParts[1] === 'minutes' || timeParts[1] === 'minute') {
        date.setMinutes(now.getMinutes() - parseInt(timeParts[0], 10));
      } else if (timeParts[1] === 'hours' || timeParts[1] === 'hour') {
        date.setHours(now.getHours() - parseInt(timeParts[0], 10));
      } else if (timeParts[1] === 'days' || timeParts[1] === 'day') {
        date.setDate(now.getDate() - parseInt(timeParts[0], 10));
      }
      return date.getTime();
    });

    // Take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_extracted_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_extracted_data.png'));

    return {
      success: true,
      action: "Extracted notification time data and converted to timestamps",
      extractedData: timestamps,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
